import './App.css';
import Navbar from './Navbar';
import Home from './pages/Home';
import Pricing from './pages/Pricing';
import About from './pages/About';



function App() {

  let component

  switch (window.location.pathname) {
    case "/":
      component = <App />
      break
    case "/pricing":
      component = <Pricing />
      break
    case "/about":
      component = <About />
    break
  }

  return (
    <>
      <Navbar />
      <component/>
    </>
  );
}

export default App;
